import 'package:audio_metadata_extractor/src/extensions/string_extension.dart';
import 'package:audio_metadata_extractor/src/flac_metadata/flac_metadata_block_header.dart';
import 'package:audio_metadata_extractor/src/flac_metadata/flac_metadata_block_picture.dart';
import 'package:test/test.dart';

void main() {
  test('flac metadata block picture ...', () {
    var raw =
        ""
            .fromHexString();
    var block =
        FlacMetadataBlockPicture.parse(FlacMetadataBlockHeader.empty(), raw);
    expect(block.pictureType, 3);
    expect(block.mimeType, "image/jpeg");
    expect(block.description, "image/jpeg");
    expect(block.width, 0);
    expect(block.height, 0);
    expect(block.bitsPerPixel, 0);
    expect(block.indexedColors, 0);
    expect(block.data.length, 58336);
  });
}
